import React from 'react'
import GoogleMapReact from 'google-map-react'


export const Store = () => {
    return(
    
    <div class="row">
    <div class="col-lg-12">
      <div class="contact-map aos-init aos-animate" data-aos="fade-up">
        <iframe width="600" height="450" style={{border:"0"}} loading="lazy" allowfullscreen
            src="https://www.google.com/maps/embed/v1/search?q=70beans,+Phase+2,+Sector+19D,+Vashi,+Navi+Mumbai,+Maharashtra,+India&key=AIzaSyAwR4sUXoYdxZx-zvyj210apUmeSgKK-vg">
            </iframe> 
        </div>
    </div>
  </div>
    );
}
